import React, { useState } from "react";
import TextField from '@mui/material/TextField';
import AdapterDateFns from '@mui/lab/AdapterDateFns';
import LocalizationProvider from '@mui/lab/LocalizationProvider';
import DateTimePicker from '@mui/lab/DateTimePicker';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import Button from '@mui/material/Button';


export default function TimelineModify(history) {
    const [mode, setMode] = useState(0)
    const [value, setValue] = useState(0)
    const today = new Date()
    return (<>
        {mode == 0 ? <>
            {/* <p>{JSON.stringify(history["history"])}</p> */}
            {/* <p>{JSON.stringify(history["history"].contents)}</p> */}
            <Button variant="text" onClick={() => setMode(1)}>수정 하기</Button>
            <Button variant="text">삭제 하기</Button></>
            : <Box
                component="form"
                sx={{
                    '& > :not(style)': { m: 1 },
                }}
                noValidate
                autoComplete="off">
                <LocalizationProvider dateAdapter={AdapterDateFns} sx={{ width: '20ch' }}>
                    <DateTimePicker
                        renderInput={(params) => <TextField {...params} />}
                        value={today}
                        onChange={(newValue) => {
                            setValue(newValue);
                        }}
                    />
                </LocalizationProvider>

                <FormControl sx={{ width: '15ch' }}>
                    <InputLabel id="weather-select-label">날씨</InputLabel>
                    <Select
                        labelId="weather-select-label"
                        id="weather-select"
                        // value={value}
                        label="weather"
                    // onChange={handleChange}
                    >
                        <MenuItem value={'맑음'}>맑음</MenuItem>
                        <MenuItem value={'구름 많음'}>구름 많음</MenuItem>
                        <MenuItem value={'흐림'}>흐림</MenuItem>
                        <MenuItem value={'비'}>비</MenuItem>
                        <MenuItem value={'비/눈'}>비/눈</MenuItem>
                        <MenuItem value={'눈'}>눈</MenuItem>
                        <MenuItem value={'소나기'}>소나기</MenuItem>
                        <MenuItem value={'데이터 없음'}>모르겠음!</MenuItem>
                    </Select>
                </FormControl>
                <FormControl sx={{ width: '15ch' }}>
                    <InputLabel id="category-select-label">카테고리</InputLabel>
                    <Select
                        labelId="category-select-label"
                        id="category-select"
                        // value={value}
                        label="category"
                    // onChange={handleChange}
                    >
                        <MenuItem value={'normal'}>일반</MenuItem>
                        <MenuItem value={'visit'}>방문</MenuItem>
                        <MenuItem value={'payment'}>결제 내역</MenuItem>
                        <MenuItem value={'study'}>공부</MenuItem>
                    </Select>
                </FormControl>
                <TextField id="outlined-basic" label={history["history"].location} variant="outlined" sx={{ width: '20ch' }} placeholder={history["history"].location} />
                <TextField id="outlined-basic" label={history["history"].address} variant="outlined" sx={{ width: '20ch' }} placeholder={history["history"].address} />
                <br />
                <TextField id="outlined-basic" label={history["history"].contents} variant="outlined" sx={{ width: '100.5ch' }} placeholder={history["history"].contents} />
                <br />
                <Button variant="text" onClick={() => setMode(0)}>수정 완료</Button>
                <Button variant="text">삭제 하기</Button>
            </Box>}
    </>)
}
